<template>
    <n-space justify="space-between"  class="bar" >
        <n-space :size="25">
            <n-button round class="title" @click="router.push('/')">唯杰地图可视化平台</n-button>
        </n-space>
        <n-space justify="center" :size="25">
            <n-tooltip v-for="item in midButtons" :key="item.id">
                <template #trigger>
                    <n-button size="small" ghost :type="item.type ?? 'primary'">
                        <template #icon>
                            <n-icon>
                                <component :is="item.icon" :color="item.color ?? '#51d6a9'"></component>
                            </n-icon>
                        </template>
                    </n-button>
                </template>
                {{ item.tooltip ?? '' }}
            </n-tooltip>
        </n-space>
        <n-space justify="end" :size="25">
            <n-tooltip v-for="item in rightButtons" :key="item.id">
                <template #trigger>
                    <n-button size="small" ghost :type="item.type ?? 'primary'" @click="item.click(item)"> 
                        <template #icon>
                            <n-icon v-if="item.icon || item.icon2">
                                <component v-if="!item.switchIcon" :is="item.icon" :color="item.color ?? '#51d6a9'"></component>
                                <component v-else :is="item.icon2" :color="item.color ?? '#51d6a9'"></component>
                            </n-icon>
                        </template>
                        {{ item.title }}
                    </n-button>
                </template>
                {{ item.tooltip ?? '' }}
            </n-tooltip>
        </n-space>
    </n-space>
    <n-modal v-model:show="showSetting" preset="dialog" title="设置" positive-text="确认" negative-text="算了" @positive-click="onSettingOk" @negative-click="onSettingCancel">
        <n-space vertical>
            服务地址：<n-input v-model:value="serviceUrl" type="text" placeholder="" />
            服务token: <n-input v-model:value="accessToken" type="text" placeholder="" />
        </n-space>
    </n-modal>
    <n-modal v-model:show="showContract" preset="dialog" title="下载源码" >
        <n-image
            width="400"
            :src="contractImage"
        />
    </n-modal>
</template>

<script setup lang="ts">
import { Moon, Sunny, Settings } from '@vicons/ionicons5'
import { reactive, ref, shallowRef } from 'vue';
import type { ButtonIconItem } from '@/types'
import { useAppStore } from "@/stores/app";
import router from '@/router';
const app = useAppStore();
const showSetting = ref(false);
const showContract = ref(false);
const serviceUrl = ref(app.serviceUrl);
const accessToken = ref(app.accessToken);
const contractImage = ref("");

const midButtons = reactive<ButtonIconItem[]>([]);
const rightButtons = reactive<ButtonIconItem[]>([]);

rightButtons.push({
    id: 'cloud',
    title: "唯杰地图云端图纸管理平台",
    tooltip: '进入唯杰地图云端图纸管理平台',
    type: 'success',
    click: () => {
        let href = window.location.origin + window.location.pathname;
        if (href.indexOf("visual") >= 0) {
            href = href.replace("visual", "cloud");
        } else {
            href = "https://vjmap.com/app/cloud/";
        }
        window.open(href,'_blank')
    }
});

rightButtons.push({
    id: 'source',
    title: "下载此项目源码",
    tooltip: '下载此项目源码',
    type: 'success',
    click: () => {
        showContract.value = true;
    }
});

rightButtons.push({
    id: 'help',
    title: "帮助",
    tooltip: '帮助',
    type: 'success',
    click: () => {
        window.open("https://vjmap.com/guide/visual.html",'_blank')
    }
});

 rightButtons.push({
    id: 'setting',
    icon: shallowRef(Settings),
    tooltip: '设置',
    type: 'info',
    click: () => { showSetting.value = true }
});

rightButtons.push({
    id: 'home',
    icon: shallowRef(Moon),
    tooltip: '主题',
    type: 'info',
    switchIcon: app.lightTheme,
    icon2: shallowRef(Sunny),
    click: (item: ButtonIconItem) => { item.switchIcon = !item.switchIcon; onTheme(); }
});


const emit = defineEmits(["onTheme"]);
const onTheme = () => {
    emit('onTheme')
}

const onSettingOk = () => {
    app.serviceUrl = serviceUrl.value;
    app.accessToken = accessToken.value;
}

const onSettingCancel = ()=> {
    serviceUrl.value = app.serviceUrl;
    accessToken.value = app.accessToken;
}

contractImage.value = "data:image/jpeg;base64,";
</script>

<style scoped>
.bar {
    margin: 3px;
}
.title {
    font-size: 1.25rem;
    line-height: 1.75rem;
    font-weight: 500;
    margin-left: 20px;
    margin-top: 0px;
}
</style>
